const fetch = require('node-fetch');       


  const search=(query, cb)=> {
    fetch(`http://localhost:81/api/marco?q=${query}`,{method: 'GET'})
      .then(res => res.text())
      .then(cb);
  }

  // async function search(query, cb) {
